import React, { Component } from 'react'
import './App.css'

import MovieList from './components/MovieList'

import styled from 'styled-components'

const Container = styled.div`
  background: #2b2e39;
  margin: 0 auto;
  width: 80%;
  max-width: 600px;
  padding: 14px;
  border-radius: 14px;
  margin-top: 14px;
`

class App extends Component {
  render () {
    return (
      <div>
        <h4>Login</h4>
        <MovieList />
      </div>
    )
  }
}

export default App
